// src/components/UI/Header.jsx
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useSubscription } from '../../hooks/useSubscription';

function Header({ view, setView, onNewTrip, onOpenSettings }) {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);
  
  // Use subscription context instead of auth
  const { isSubscribed } = useSubscription();
  
  // Handle navigation
  const handleNavigate = (newView) => {
    setView(newView);
    
    // Map views to routes
    const routes = {
      dashboard: '/',
      planner: '/planner',
      trips: '/trips',
      flights: '/flights'
    };
    
    // Navigate to the corresponding route
    if (routes[newView]) {
      navigate(routes[newView]);
    }
    
    // Close menu on mobile
    setMenuOpen(false);
  };
  
  // Toggle mobile menu
  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };
  
  return (
    <header className="app-header">
      <div className="header-container">
        <div className="logo">
          <Link to="/" onClick={() => handleNavigate('dashboard')}>
            <img src="/logo.png" alt="Travel Planner Logo" className="logo-img" />
            <span className="logo-text">Travel Planner</span>
          </Link>
        </div>
        
        <div className="desktop-nav">
          <nav className="main-nav">
            <ul>
              <li className={view === 'dashboard' ? 'active' : ''}>
                <button onClick={() => handleNavigate('dashboard')}>Dashboard</button>
              </li>
              <li className={view === 'planner' ? 'active' : ''}>
                <button onClick={() => handleNavigate('planner')}>Plan Trip</button>
              </li>
              <li className={view === 'trips' ? 'active' : ''}>
                <button onClick={() => handleNavigate('trips')}>My Trips</button>
              </li>
              <li className={view === 'flights' ? 'active' : ''}>
                <button onClick={() => handleNavigate('flights')}>Flight Deals</button>
              </li>
            </ul>
          </nav>
          
          <div className="user-actions">
            <button 
              className="settings-btn"
              onClick={onOpenSettings}
              aria-label="Settings"
            >
              <i className="icon-settings"></i>
            </button>
            
            {/* Login/Profile button - now simplified without auth dependency */}
            <Link 
              to={isSubscribed ? "/settings" : "/subscription/plans"} 
              className="profile-btn"
            >
              {isSubscribed ? 'My Account' : 'Upgrade'}
            </Link>
          </div>
        </div>
        
        {/* Mobile menu button */}
        <button 
          className="mobile-menu-btn" 
          onClick={toggleMenu}
          aria-label={menuOpen ? "Close menu" : "Open menu"}
        >
          <span className={`hamburger ${menuOpen ? 'active' : ''}`}></span>
        </button>
      </div>
      
      {/* Mobile menu */}
      {menuOpen && (
        <div className="mobile-menu">
          <nav>
            <ul>
              <li>
                <button onClick={() => handleNavigate('dashboard')}>Dashboard</button>
              </li>
              <li>
                <button onClick={() => handleNavigate('planner')}>Plan Trip</button>
              </li>
              <li>
                <button onClick={() => handleNavigate('trips')}>My Trips</button>
              </li>
              <li>
                <button onClick={() => handleNavigate('flights')}>Flight Deals</button>
              </li>
              <li>
                <button onClick={onOpenSettings}>Settings</button>
              </li>
              <li>
                <Link 
                  to={isSubscribed ? "/settings" : "/subscription/plans"}
                  onClick={() => setMenuOpen(false)}
                >
                  {isSubscribed ? 'My Account' : 'Upgrade'}
                </Link>
              </li>
            </ul>
          </nav>
        </div>
      )}
    </header>
  );
}

export default Header;
